import React, { Component } from "react";
import Slider from "react-slick";
import '../component-styles/certification.css'

export default class CertificationSlider extends Component {
  render() {
    const settings = {
      dots: false,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div className="certification-main-container">
        <Slider {...settings}>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        <div className="certification-container"><div className="inner-certification-container">1</div></div>
        </Slider>
      </div>
    );
  }
}
